import React from 'react';
import School from "./Components/school.js"
import Personal from "./Components/personal.js";
import "semantic-ui-css/semantic.min.css";
import styled from "styled-components";
import axios from "axios";
import './App.scss';


console.log(axios.get("http://dataservice.accuweather.com/currentconditions/v1/330289?apikey=gl1kPHFBQKns6clBxYMp19MgsbXr9aKc&language=en-us&details=true"));





const MainContainer = styled.div `
  display: flex;
  flex-direction: row;
`;

const LinksContainer = styled.div `
  display: flex;
  flex-direction: column;


`;

function App() {
  return (
    <div className="App">
      <MainContainer>
      <LinksContainer>
      <School></School>
      <Personal></Personal>
      </LinksContainer>
      </MainContainer>
    </div>
  );
}

export default App;
